import React,{useState} from 'react';
import {data} from "./data";
import Todos from "./components/Todos";
import TodoForm from "./components/TodoForm";
const App = () => {
    const [state, setState] = useState(data);

    return (
        <div>
            {state.map(todos => (
                <Todos key={Math.random() *1000} todos={todos}/>
            ))}
            <TodoForm/>
        </div>
    );
};

export default App;
